== History of state politics ==

The history of politics is reflected in the origin, development, and economics of the institutions of [[government]]

===
{{Main|State (polity)}}

The origin of the [[State (polity)|state]] is to be found in the development of the [[Art of Warfare|art of warfare]]. Historically speaking, all political communities of the modern type owe their existence to successful warfare.<ref>{{cite journal|last=

'''Fictions:''' Records and Law Courts were valuable in helping the people adapt to law-making but like Fictions, they were slow and imperfect. Though slowly, Fictions work because it is a well-known fact that people will accept a change in the form of a fiction while they would resist it to the end if the fact is out in the open.

Finally there is the enactment of laws or legislation. When progress and development is rapid, the faster method of [[political representation]] is adopted. This method does not originate in primitive society but in the State's need for money and its use of an assembly to raise the same. From the town assembly, a national assembly and the progress of commerce sprang [[parliament]]s all over Europe around the end of the 12th century, but not entirely representative or homogeneous for the nobility and the clergy. The clergy had amassed a fortune in land, about one-fifth of all Christendom but at the time, in the 12th and 13th centuries, the Church was following a policy of isolation; they adopted the rule of [[celibacy]] and cut themselves from domestic life; they refused to plead in a secular court; they refused to pay taxes to the State on the grounds that they had already paid it to the [[Pope]]. Since the main object of the king in holding a national assembly was to collect money, the Church could not be left out and so they came to Parliament. The Church did not like it but in most cases they had to come.{{Citation needed|date=January 2011}}

The medieval Parliament was complete when it represented all the states in the realm: nobles, clergy, peasants and craftsmen but it was not a popular institution mainly because it meant [[taxation]]. Only by the strongest pressure of the Crown were Parliaments maintained during the first century of their existence and the best proof of this assertion lies in the fact that in those countries where the Crown was weak, Parliament ceased to exist. The notion that parliaments were the result of a democratic movement cannot be supported by historical facts. Originally, the representative side of Parliament was solely concerned with money; representation in Parliament was a liability rather than a privilege. It is not uncommon that an institution created for one purpose begins to serve another. People who were asked to contribute with large sums of money began to [[petition]]. Pretty soon, sessions in Parliament would turn into bargaining tables, the king granting petitions in exchange for money. However, there were two kinds of petitions, one private and the other public and it was from this last that laws were adopted or [[legislation]] originated. The king as head of State could give orders to preserve territorial integrity but not until these royal enactments were combined with public petition that successful legislation ever took place. Even to the present day, this has always been the basis of all successful legislation: public custom is adopted and enforced by the State.{{Citation needed|date=January 2011}}

In the early days of political representation, the [[majority]] did not necessarily carry the day and there was very little need for contested [[election]]s but by the beginning of the 15th century, a seat in Parliament was something to be cherished. Historically speaking, the dogma of the equality of man is the result of the adoption of the purely practical machinery of the majority, but the adoption of the majority principle is also responsible for another institution of modern times: the [[party system]]. The party system is an elaborate piece of machinery that pits at least two political candidates against each other for the vote of an electorate; its advantage being equal representation interesting a large number of people in politics; it provides effective criticism of the government in power and it affords an outlet for the ambition of a large number of wealthy and educated people guaranteeing a consistent policy in a state.{{Citation needed|date=January 2011}}

These three institutions: political representation, majority rule and the party system are the basic components of modern political machinery; they are applicable to both central and local governments and are becoming by their adaptability ends in themselves rather than machinery to achieve some purpose.<ref>{{cite book |last=Jenks |first=Edward |title=A history of politics |pages=

The State, of course, did not create poverty but by destroying the chief agencies which dealt with it such as the village, the church and the [[guild]]s, it practically assumed full responsibility for the poor without exercising any power over it. The Great Poor Law Report of 1834 showed that [[communism]] was widespread in the rural areas of England. In newly developed countries such as the [[colonies]] of the [[British Empire]], the State has refused to take responsibility for the poor and the relief of poverty, although the poor classes lean heavily towards State socialism.{{Citation needed|date=January 2011}}

Taking into account the arguably significant powers of the State, it is only natural that in times of great crisis such as an overwhelming calamity the people should invoke general State aid.{{Citation needed|date=January 2011}}

Political representation has helped to shape State administration. When the voice of the individual can be heard, the danger of arbitrary interference by the State is greatly reduced. To that extent is the increase of State activity popular. There are no hard and fast rules to limit State administration but it is a fallacy to believe that the State is the nation and what the State does is necessarily for the good of the nation. In the first place, even in modern times, the State and the nation are never identical. Even where "universal suffrage" prevails, the fact remains that an extension of State administration means an increased interference of some by others, limiting freedom of action. Even if it is admitted that State and nation are one and the same, it is sometimes difficult to admit that State administration is necessarily good. Finally, the modern indiscriminate advocacy of State administration conceals the fallacy that State officials must necessarily prove more effective in their action than [[private enterprise]]. Herein lies the basic difference between [[Public administration|public]] and [[business administration]]; the first deals with the [[public weal]] while the second deals basically in [[Profit (accounting)|profit]], but both require a great deal of [[education]] and [[ethical code|ethical conduct]] to avoid the mishaps inherent in the relationship not only relating to [[Corporate law|business]] and [[labour rights|labour]] but also the State and the people administrating its [[government]].<ref>{{cite book |last=Jenks |first=Edward |title=A history of politics |pages=

